window.bookSummaryJSON = "<p>Percy Jackson isn't expecting freshman orientation to be any fun. But when a mysterious mortal acquaintance appears on campus, followed by demon cheerleaders, things quickly move from bad to worse. </p> <p>In this latest installment of the blockbuster series, time is running out as war between the Olympians and the evil Titan lord, Kronos, draws near. Even the safe haven of Camp Half-Blood grows more vulnerable by the minute as Kronos' army prepares to invade its once impenetrable borders. To stop the invasion, Percy and his demigod friends must set out on a quest through the Labyrinth - a sprawling underground world with stunning surprises at every turn. </p> <p>Full of humor and heart-pounding action, this audiobook promises to be their most thrilling adventure yet.</p>"; 
